column3:
"Hello {{user_name}}, it's time to take care of your mind and body! You have been working hard, staying active and fueling your body with the right foods. That's fantastic! However, sometimes, we need to take a break and let our bodies recover. So, why not indulge in a lazy day or two, watch some movies, and enjoy your downtime? Your body will thank you. In the meantime, be sure to stay hydrated, eat nutritious meals, and get plenty of rest. Don't forget that taking care of yourself mentally is just as important as taking care of your physical health. So, take a break, relax, and let your mind recharge. You got this! Much love, your coach."

We hope this message helps you stay motivated and on track towards your fitness goals. Let us know how you're doing! {{smile}}
User

